import React, { FC, ReactElement } from 'react';
import { Helmet } from 'react-helmet';
import { makeStyles, createStyles, Theme } from "@material-ui/core/styles";
import Aboutme from './Aboutme';
import 'firebase/firestore';
import Image from 'material-ui-image';
import { FirebaseAppProvider, useFirestoreDocData, useFirestore, SuspenseWithPerf } from 'reactfire';
// components
import PageTitle from "../components/PageTitle";
import Card from '@material-ui/core/Card';
// constants
import { APP_TITLE, ABOUTME} from '../utils/constants';

// define css-in-js
const useStyles = makeStyles((theme: Theme) =>
    createStyles({
        root: {
            flex: 1,
            display: "flex",
            flexDirection: "row",
            justifyContent: "space-between",
        },
        aboutme:{
          float: "right",
          width: "45%",
          padding: "40px",
          height: "475px",
           margin:"30px",
           background: "#fafafa",

        },
        quote:{
          float: "left",
          width: "45%",
          padding: "40px",
          height: "475px",
           margin:"30px",


        },


    })
);
const firebaseConfig = {
  apiKey: "AIzaSyDQs2KPcGmYmP5KflHNft-MEYtjb4JP3dI",
  authDomain: "adminpanel-257a3.firebaseapp.com",
  projectId: "adminpanel-257a3",
  storageBucket: "adminpanel-257a3.appspot.com",
  messagingSenderId: "959454529762",
  appId: "1:959454529762:web:2bb8ce08f4c3f0087476bb"
};
const Dashboard: FC<{}> = (): ReactElement => {
    const classes = useStyles();
    return (
        <>
        <FirebaseAppProvider firebaseConfig={firebaseConfig}>
            <Helmet>
                <title className={classes.titles}>{} | {APP_TITLE}</title>
            </Helmet>
            <div className={classes.root}>
            <PageTitle title={ABOUTME} />
            </div>
          <Aboutme />
            </FirebaseAppProvider>
        </>
    )
}

export default Dashboard;
